import React from "react";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const AddBook = () => {
  return (
    <div className="addbook">
       <Box
      sx={{
        width: 500,
        maxWidth: '100%',
        margin: 10,
      }}
    >
      <p>Book Name:</p><TextField fullWidth label="Book Name" id="fullWidth" margin="normal"/>
      <p>Auther Name:</p><TextField fullWidth label="Auther Name" id="fullWidth" margin="normal"/>
      <p>Edition:</p><TextField fullWidth label="Edition" id="fullWidth" margin="normal"/>
      <p>Number of Copies:</p><TextField fullWidth type='number' label="Number of Copies" id="fullWidth" margin="normal"/>
      <p>Date:</p><TextField fullWidth type='date' label="Available In Library Date" id="fullWidth" margin="dense"/>
    </Box>
    </div>
  );
};

export default AddBook;
